glsl3.vert:
precision highp float;
uniform CCGlobal {
  mat4 cc_matView;
  mat4 cc_matViewInv;
  mat4 cc_matProj;
  mat4 cc_matProjInv;
  mat4 cc_matViewProj;
  mat4 cc_matViewProjInv;
  vec4 cc_cameraPos;
  vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_screenScale;
};
uniform CCLocal {
  mat4 cc_matWorld;
  mat4 cc_matWorldIT;
};
in vec3 a_position;
in vec4 a_color;
out vec4 v_color;
in vec2 a_uv0;
out vec2 v_uv0;
void main () {
  gl_Position = cc_matViewProj * vec4(a_position, 1);
  v_uv0 = a_uv0;
  v_color = a_color;
}

glsl3.frag:
precision highp float;
uniform CCGlobal {
  mat4 cc_matView;
  mat4 cc_matViewInv;
  mat4 cc_matProj;
  mat4 cc_matProjInv;
  mat4 cc_matViewProj;
  mat4 cc_matViewProjInv;
  vec4 cc_cameraPos;
  vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_screenScale;
};
uniform CCLocal {
  mat4 cc_matWorld;
  mat4 cc_matWorldIT;
};
in vec4 v_color;
in vec2 v_uv0;
uniform sampler2D texture;
uniform Properties {
  float edge;
};
void main () {
  vec4 o = vec4(1, 1, 1, 1);
  o *= texture(texture, v_uv0);
  o *= v_color;
  vec2 uv = v_uv0.xy - vec2(0.5, 0.5);
  float rx = abs(uv.x) - (0.5 - edge);
  float ry = abs(uv.y) - (0.5 - edge);
  float mx = step(0.5 - edge, abs(uv.x));
  float my = step(0.5 - edge, abs(uv.y));
  float radius = length(vec2(rx, ry));
  float a = 1.0 - mx * my * step(edge, radius) * smoothstep(0., edge * 0.01, radius - edge);
  gl_FragColor = vec4(o.rgb, o.a * a);
}

glsl1.vert:
precision highp float;
uniform mat4 cc_matViewProj;
attribute vec3 a_position;
attribute vec4 a_color;
varying vec4 v_color;
attribute vec2 a_uv0;
varying vec2 v_uv0;
void main () {
  gl_Position = cc_matViewProj * vec4(a_position, 1);
  v_uv0 = a_uv0;
  v_color = a_color;
}

glsl1.frag:
precision highp float;
varying vec4 v_color;
varying vec2 v_uv0;
uniform sampler2D texture;
uniform float edge;
void main () {
  vec4 o = vec4(1, 1, 1, 1);
  o *= texture2D(texture, v_uv0);
  o *= v_color;
  vec2 uv = v_uv0.xy - vec2(0.5, 0.5);
  float rx = abs(uv.x) - (0.5 - edge);
  float ry = abs(uv.y) - (0.5 - edge);
  float mx = step(0.5 - edge, abs(uv.x));
  float my = step(0.5 - edge, abs(uv.y));
  float radius = length(vec2(rx, ry));
  float a = 1.0 - mx * my * step(edge, radius) * smoothstep(0., edge * 0.01, radius - edge);
  gl_FragColor = vec4(o.rgb, o.a * a);
}
